import './App.css';
import './Style/style.css';
// import Routess from './route';


class App extends Component {
  render() {
    return (
      <div>
        <div>
          <span>firstname</span>
          <input ref={(input) => { this.firstname = input }} type="text" />
        </div>
        <div>
          <span>lastname</span>
          <input type="text" />
        </div>
        <div>
          <span>age</span>
          <input type="text" />
        </div>
        <input type="submit" value="submit" />
      </div>
    );
  }
}

export default App;


